import React, {useState, useEffect} from 'react';
import "./App.scss";
import { Login } from "./components/login/index";

function App() {

  const [data, setData] = useState([{}])

  useEffect(() => {
    fetch("/members").then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])

  return (
    <div className='App'>
      <Login />
    </div>
  )
}

export default App
